import React from "react";
import { TodoType } from "../../utils/types";
import { Container, RowContainer, Title, Button } from "../../ui-kit";

interface TodoProps {
  todo: TodoType;
  doneTodo: any;
  updateTodo: any;
  deleteTodo: any;
}

export const Todo: React.FC<TodoProps> = ({
  todo,
  doneTodo,
  updateTodo,
  deleteTodo,
}) => {
  return (
    <Container>
      <RowContainer>
        <Button onClick={() => deleteTodo(todo.id)}>Done</Button>
        <Title>{todo.name}</Title>
        <Button color="RED" onClick={() => deleteTodo(todo.id)}>
          Delete
        </Button>
      </RowContainer>
    </Container>
  );
};
